import React from "react";
import {Container, ContentSection, TitleCont, TextCont, NumberCont, LineThrough } from "./styles";

/*import {ReactComponent as CPUSvg} from "../../assets/svg/cpu.svg";*/

type TitleProps = {
    text: string;
    numb: string;
}
const Title = ({text, numb}: TitleProps) =>{
    return <section><NumberCont>{numb}. </NumberCont><TitleCont>{text}</TitleCont></section>
}

const Text = ({children}: {children: React.ReactNode})=>{
    return <TextCont>{children}</TextCont>
}
const WhatIs:React.FC = ()=>{
    return(
        <ContentSection>
            <Container>
                <Title text = "Teste" numb = "1"></Title>
                <TextCont>A transição do <LineThrough>maternal</LineThrough> ensino médio/cursinho para a universidade é algo que assusta muitos calouros, e é algo bem comum. No entanto, vocês verão que <LineThrough>nunca</LineThrough> em pouco tempo estarão acostumados à vida universitária. O campus de São Carlos é um ambiente agradável e de fácil locomoção. A cidade oferece uma vasta gama de lojas e serviços ao universitário, e o pessoal da universidade é amigável e está sempre disposto a auxiliar o próximo.  Seja lá quais forem suas dúvidas e preocupações, nós da <b>SAEComp</b> estaremos sempre presentes e prontos para auxiliar em qualquer situação. Este manual busca sanar dúvidas frequentes e fornecer dicas úteis aos calouros do curso através de textos informais e objetivos, evitando uma leitura cansativa ou o bombardeamento de informações, então só vai e leia essa budega!  Não se preocupe, bixo/bixete! Sinta-se orgulhoso por ter entrado na USP e aproveite os melhores anos que você terá na sua vida!</TextCont>
            </Container>
        </ContentSection>
    );
}

export default WhatIs;
